#include <stdio.h>

int main (void)
{
    int n1, n2, sum=0;
    scanf("%d %d", &n1, &n2);

    while (1)
    {
        if ((n1 & 1) == 1)
        {
            sum += n2; 
        }
        n1 >>= 1;
        n2 <<= 1;
        
        if (n1 == 1)
        {
            sum += n2;
            break;
        }
    }
    printf("%d", sum);
    return 0;
}
